        "groundingSupports": [
          {
            "segment": {
              "endIndex": 87,
              "text": "Otters are carnivorous mammals known for their long, slender bodies and playful nature."
            },
            "groundingChunkIndices": [
              0,
              1
            ]
          },
          {
            "segment": {
              "startIndex": 88,
              "endIndex": 270,
              "text": "These semi-aquatic animals are well-adapted for life in and out of water, with dense fur to keep them warm, webbed feet for swimming, and the ability to hold their breath underwater."
            },
            "groundingChunkIndices": [
              0,
              1,
              2
            ]
          },
          {
            "segment": {
              "startIndex": 271,
              "endIndex": 412,
              "text": "There are 14 known species of otters, which can be found in a variety of aquatic habitats on every continent except Australia and Antarctica."
            },
            "groundingChunkIndices": [
              0,
              2
            ]
          },
          {
            "segment": {
              "startIndex": 414,
              "endIndex": 520,
              "text": "The diet of an otter primarily consists of fish and aquatic invertebrates like crayfish, crabs, and frogs."
            },
            "groundingChunkIndices": [
              3,
              4,
              5
            ]
          },
          {
            "segment": {
              "startIndex": 521,
              "endIndex": 671,
              "text": "Sea otters are particularly known for eating marine invertebrates such as sea urchins and clams, and famously use rocks as tools to crack open shells."
            },
            "groundingChunkIndices": [
              4,
              6
            ]
          },
          {
            "segment": {
              "startIndex": 672,
              "endIndex": 769,
              "text": "Due to a high metabolism, otters need to eat a significant portion of their body weight each day."
            },
            "groundingChunkIndices": [
              5
            ]
          },
          {
            "segment": {
              "startIndex": 815,
              "endIndex": 893,
              "text": "While some species, like river otters, can be solitary, others live in groups."
            },
            "groundingChunkIndices": [
              0,
              7
            ]
          },
          {
            "segment": {
              "startIndex": 894,
              "endIndex": 1040,
              "text": "They are known for their playful antics, such as sliding down riverbanks, which is believed to strengthen social bonds and improve hunting skills."
            },
            "groundingChunkIndices": [
              0,
              8
            ]
          },
          {
            "segment": {
              "startIndex": 1041,
              "endIndex": 1135,
              "text": "Otters communicate through a variety of vocalizations, including chirps, whistles, and growls."
            },
            "groundingChunkIndices": [
              9,
              2
            ]
          },
          {
            "segment": {
              "startIndex": 1136,
              "endIndex": 1235,
              "text": "They build dens, called holts, in locations like tree roots or rock cavities near the water's edge."
            },
            "groundingChunkIndices": [
              0,
              10
            ]
          }
